import { useState } from "react";

const test = () =>{
    // 더미데이터
   

    const length = (bannerStyle) =>{
        console.log(bannerStyle.length)
        console.log(bannerStyle[0])
    } 
    const select = (bannerStyle)=>{
        for( let i=0; bannerStyle.length>=i;i++){
            console.log(bannerStyle[i]["img"])
            console.log(bannerStyle[i]["url"])
        }
    }
    return {length,select}

}
export default test;
